      Value: "<p>Although Nancy does not own any animals currently, she does love all kinds of animals. Nancy was raised on a farm with many dogs and cats, and she had her own horse. As a youngster, Nancy was active in 4-H with a focus on sheep. Nancy has been employed by Farnam for 35 years and loves the team she works with. Nancy has been involved in many areas of Farnam and is currently the Farnam Headquarters Facility Manager.</p>"
